import React, { useContext } from 'react'
import { UrlsContext } from '../contexts/UrlsContext'

const UrlsList = () => {
  const { urls } = useContext(UrlsContext)

  return (
    <div>
      <h1>Urls</h1>
      {urls.length !== 0 ? (
        urls.map(url => (
          <div key={url.id}>
            <p>{url.url}</p>
          </div>
        ))
      ) : (
        <p>No urls here!</p>
      )}
    </div>
  )
}

export default UrlsList
